$(document).ready(function(){	
	var lib = [];
	$.each(data, function(i,k){
		lib.push(k[0]);
	});
			
	//kanji	
	$('#tin').val("");
	var kfoundunq = [['','','']];	
	$("#tin").bind('input propertychange', function(){		
		kfoundunq = [['','','']];	
		var ktext = $('#tin').val().replace(/\n/g, '<br/>').replace(/\t/g, '&nbsp;&nbsp;&nbsp;&nbsp;').split("");
		var kfound = [];
		var kfoundid = [];
		$('#tout').html(function(i,val){		
			$.each(ktext, function(i,k){
				var inF = $.inArray(k, lib);
				if(inF !== -1){										
					ktext[i] = k.replace(lib[inF], '<span id="'+inF+'">'+lib[inF]+'</span>');
					kfound.push(ktext[i]+' ');
					kfoundid.push(inF);
				}else{
					if(k == ' ') ktext[i] = '&nbsp;';									
				}
			});
			return ktext.join('');			
		});		
				
		$.each(kfound, function(i, val){			
			//var kid = kfoundid[i]; //sort by number
			var kid = data[kfoundid[i]][5]; //sort by frequency
			var indx = kfoundunq.findIndex(arr => arr.includes(kid));
			if(indx == -1){						
				kfoundunq.push([kid, val, 1]);
			}else{
				kfoundunq[indx][2] += 1;
			}
		});		
		
		var toutA = "";
		var toutB = [];
		kfoundunq.sort((a, b) => a[0] - b[0]);
		$.each(kfoundunq, function(i, val){
			if(kfoundunq[i][0]){
				if(kfoundunq[i][2] == 1) kfoundunq[i][2] = '&nbsp;';
				toutA += '<em>'+kfoundunq[i][1].replace('> ', '>') + '<sup>'+kfoundunq[i][2]+'</sup><i>'+kfoundunq[i][0]+'</i>&nbsp;</em>';
				toutB.push(kfoundunq[i][0]);
			}
		});		
		$('#tfound').html('<p>' +toutA.slice(0,-2)+'</p>');		
		
		//upd height
		$('#tin').css('height', $('#tout').height()+60);		
		
		//learn
		tlearnFind();		
	});	
	
	
	//learn
	function tlearnFind(){
		var tl = $('#tin').val().split("\n");
		var tlx = [];
		$.each(kfoundunq, function(i, val){			
			if(parseInt(kfoundunq[i][0]) > $('#tlmax').val()){				
				var g = kfoundunq[i][1].split("");
				var f = 0;
				$.each(g, function(j, t){
					if($.inArray(t, lib) != -1 && f==0){
						f = 1;	
						tlx.push(t);
					}
				});
			}
		});
		
		var tlearn = "";
		var tlearnAfter = "";
		$.each(tl, function(i, val){
			var tls = val.split("");
			var f = 1;
			$.each(tls, function(j, t){
				if($.inArray(t, tlx) != -1) f = 0;					
			});
			if(f == 0) tlearnAfter += val +'<br>';
			if(f == 1) tlearn += val +'<br>';
		});		
		$('#tlearn').html(tlearn+'<br><hr><br>'+tlearnAfter);
	}
	$("#tlmax").bind('input propertychange', function(){
		tlearnFind();
	});	
	
	//popup		
	$(document).on("mousemove", function (event) { 		
		if(event.ctrlKey && !event.altKey){
			$(".wrapper").addClass("ctr");
		}else{
			$(".wrapper").removeClass("ctr");
		}
	});
	
	var cid = -1;
	$(document).on("mousemove", ".ctr #tout span, .ctr #tfound span", function() {	
		if(cid != $(this).attr("id")){
			cid = $(this).attr("id");
			$('#kdpp').html('<p>'+data[cid][0]+' '+data[cid][1]+'</p><p>'+data[cid][2]+'</p><p>'+data[cid][3]+'</p><p>'+data[cid][4]+'</p>');	 
		}
			$('#kdpp').show();     
	});
	
	$(document).on("mouseleave", "#tout span, #tfound span", function() {
		$('#kdpp').hide();
	});
	
	var moveLeft = 15;
	var moveDown = -25;
	$(document).on( "mousemove", ".ctr #tout span, .ctr #tfound span", function(e) {
		$("#kdpp").css('top', e.pageY + moveDown).css('left', e.pageX + moveLeft);
	});	
	
	$(document).on("mousedown", "#tout", function() {	
		$("#kdpp").addClass("hide");
	});
	$(document).on("mouseup", "#tout", function() {
		$("#kdpp").removeClass("hide");
	});
	
	
	//slide highlight on/off
	if(!$("#highlight").is(':checked')){
		$(".container").removeClass('highlight'); 
	}
	$("#highlight").change(function() {
		$(".container").toggleClass('highlight'); 
	});
	
	
	//found highlight
	if($("#learn").is(':checked')){
		$(".klearn").removeClass('hide'); 
	}
	$("#learn").change(function() {
		$(".klearn").toggleClass('hide'); 
	});
	
	$(document).on( "mouseenter", "#tfound span", function(e) {
		$("#tout #"+$(this).attr("id")).addClass('tfoundHL');
	});	
	$(document).on( "mouseleave", "#tfound span", function(e) {
		$("#tout span").removeClass('tfoundHL');
	});	
});
